import 'package:json_annotation/json_annotation.dart';part 'job_model_dto.g.dart';@JsonSerializable(ignoreUnannotated: false)class JobModelDto {  @JsonKey(name: 'id')  final int? id;  @JsonKey(name: 'jobName')  final String? jobName;  @JsonKey(name: 'icon')  final String? icon;  JobModelDto({this.id, this.jobName, this.icon});  factory JobModelDto.fromJson(Map<String, dynamic> json) => _$JobModelDtoFromJson(json);  Map<String, dynamic> toJson() => _$JobModelDtoToJson(this);}